import React, { Component } from "react";

class CreateBlog extends Component {
  state = {
    blog: ""
  };
  render() {
    return (
      <div className="container">
        <h2>Write a Blog</h2>
        <textarea className="col-md-12" rows="25"></textarea>
        <div>
          <br />
          <button className="float-right btn btn-danger">Submit</button>
        </div>
      </div>
    );
  }
}

export default CreateBlog;
